import '../App.css';
import React from 'react';
import ProgressBar from 'react-bootstrap/ProgressBar'

class Running extends React.Component{
  constructor(props) {
    super(props);          
    this.state={uploadProgress : 1}
  }
  function(){
    while(this.state.uploadProgress <= 100){
      this.state.uploadProgress= this.state.uploadProgress+1;
    }
    return this.state.uploadProgress;
  }

    render(){
      return <div className="App-main" >

                <br></br>                 
                <h1>The experience is running</h1><br></br><br></br><br></br>

                <ProgressBar variant="warning" animated now={this.function} label={`${this.state.uploadProgress}% completed`} />
            </div>
      }


}   
export default Running;
